    const {products} = useTypedSelector(state => state.product)
    console.log(products);



    return (
        <div className="ProductContainer">
            {products.map( el => (
                <ProductElement key={el.id} props={el} />
            ))}
            <ProductElement />
            <ProductElement />
            <ProductElement />
            <ProductElement />
            <ProductElement />
            <ProductElement />
        </div>
    )
}

export default ProductContainer
